(2, 'Operator Relawan Cakra19 Bidang Komunikasi D.I. Yogyakarta', 'Sedang melakukan rekapitulasi dokumen berupa foto dari masing-masing TPS yang ada di Yogyakarta, data diambil dari 5 kabupaten (Gunungkidul, Kulonprogo, bantul, sleman, Kota Yogyakarta). ', 'kntn-04011918-Operator.jpg', '2019-04-17 13:19:18'),
(3, 'Operator Relawan Cakra19 Bidang Komunikasi D.I. Yogyakarta', 'Sedang melakukan rekapitulasi dokumen berupa foto dari masing-masing TPS yang ada di Yogyakarta, data diambil dari 5 kabupaten (Gunungkidul, Kulonprogo, bantul, sleman, Kota Yogyakarta). #17 April 2019 ', 'kntn-04013454-operator1.jpg', '2019-04-17 13:34:54'),
